<!DOCTYPE html><html dir="ltr" mozdisallowselectionprint><head><meta charset="utf-8"><meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1 user-scalable=no"><meta name="google" content="notranslate"><title> PDF viewer</title><link rel="stylesheet" href="viewer.css"><script src="../build/pdf.min.js"></script><script src="../../jq.js"></script><script src="viewer.js"></script></head><body tabindex="1"><div id="outerContainer"><div id="mainContainer"><div class="toolbar"><div id="toolbarContainer"><div id="toolbarViewer"><div id="toolbarViewerLeft"><div class="toolbarButtonSpacer"></div><div class="splitToolbarButton hiddenSmallView"><button class="toolbarButton" title="Previous Page" id="previous" tabindex="13" data-l10n-id="previous"><span data-l10n-id="previous_label">Previous</span></button><div class="splitToolbarButtonSeparator"></div><button class="toolbarButton" title="Next Page" id="next" tabindex="14" data-l10n-id="next"><span data-l10n-id="next_label">Next</span></button></div><input type="number" id="pageNumber" class="toolbarField" title="Page" value="1" min="1" tabindex="15" data-l10n-id="page" autocomplete="off"><span id="numPages" class="toolbarLabel"></span></div><div id="toolbarViewerMiddle"><div class="splitToolbarButton"><button id="zoomOut" class="toolbarButton" title="Zoom Out" tabindex="21" data-l10n-id="zoom_out"><span data-l10n-id="zoom_out_label">Zoom Out</span></button><div class="splitToolbarButtonSeparator"></div><button id="zoomIn" class="toolbarButton" title="Zoom In" tabindex="22" data-l10n-id="zoom_in"><span data-l10n-id="zoom_in_label">Zoom In</span></button></div><span id="scaleSelectContainer" class="dropdownToolbarButton"><select id="scaleSelect" title="Zoom" tabindex="23" data-l10n-id="zoom"><option id="pageAutoOption" title="" value="auto" selected="selected" data-l10n-id="page_scale_auto"> Automatic Zoom</option><option id="pageActualOption" title="" value="page-actual" data-l10n-id="page_scale_actual">Actual Size </option><option id="pageFitOption" title="" value="page-fit" data-l10n-id="page_scale_fit">Page Fit</option><option id="pageWidthOption" title="" value="page-width" data-l10n-id="page_scale_width">Page Width </option><option id="customScaleOption" title="" value="custom" disabled="disabled" hidden="true"></option><option title="" value="0.5" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 50 }'>50% </option><option title="" value="0.75" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 75 }'>75% </option><option title="" value="1" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 100 }'>100% </option><option title="" value="1.25" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 125 }'>125% </option><option title="" value="1.5" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 150 }'>150% </option><option title="" value="2" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 200 }'>200% </option><option title="" value="3" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 300 }'>300% </option><option title="" value="4" data-l10n-id="page_scale_percent" data-l10n-args='{ "scale": 400 }'>400% </option></select></span></div></div><div id="loadingBar"><div class="progress"><div class="glimmer"></div></div></div></div></div><div id="viewerContainer" tabindex="0"><div id="viewer" class="pdfViewer"></div></div></div></div></div></body></html>
